import React from 'react';


function Prstest(props){
    return (
        <div className='mt-5 col-md-4 col-sm-6 border text-center'>
            <div className='card'>
                <div className='card-header'>

                </div>
                <div className='card-body'>
                <h5 >{props.nom}</h5>  
                    <p>{props.travail}</p>
                    <p>{props.email}</p>
                    <p>{props.telephone}</p>
                </div>
            </div>
           
             
        </div>
    );
}

export default Prstest;
